import React, { Component } from 'react'

export default class message extends Component {


constructor(){

    super();
    this.state = {
        message:" Welcome! Click the button for a secret message! "
    };
}

changeMessage(){
    this.setState({
        message: "thanks for clicking me, youre almost there",
    })
}








  render() {
    return (
      <div>
        <h1>{this.state.message}</h1>
        <button onClick={() => this.changeMessage() }>this will change</button>
      </div>
    )
  }
}
